import React from "react";
import { Button } from "react-bootstrap";

const Cart = () => {
  const cartItems = [
    {
      itemName: "Cornbread",
      itemPrice: 3,
      imgSrc: ""
    },
    {
      itemName: "Grilled corn",
      itemPrice: 4,
      imgSrc: ""
    }
  ];

  const renderedCartItems = cartItems.map((cartItem) => {
    return (
      <div className="item pad">
        <div className="img-box">
          <img src={cartItem.imgSrc} alt=""/>
        </div>
        <div className="about">
          <h1 className="title">{cartItem.itemName}</h1>
        </div>
        <div className="counter">
          <Button className="btn">+</Button>
          <div className="counter">Render counter here</div>
           <Button className="btn">-</Button>
        </div>
      </div>
    );
  });

  return (
    <div className="page-body">
      <div className="container">
        <div className="header">
          <h3 className="cart-heading">Shopping Cart</h3>
          <h5 className="cart-action">Remove All</h5>
        </div>
        <div className="cart-item">
          <div className="cart-img-box">
            <img src=""/>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Cart;
